import { Outlet,Link } from "react-router-dom"

const ProductRouter = () => {

  return(
    <Routes>
        <Route path="/products" element={<ProductsPage />} />
        <Route path="/products/:id" element={<ProductDetailsPage />} />
    </Routes>
  )
}

export default ProductRouter;
